DROP TABLE IF EXISTS `run_api`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `run_api` (
  `id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键',
  `action_key` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '接口路径',
  `controller` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '控制器',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '备注',
  `title` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '接口标题',
  `description` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '接口描述',
  `request_url` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '请求路径',
  `request_mode` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '请求方式',
  `request_headers` varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '请求Headers参数',
  `request_body_type` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '请求的bodyType类型',
  `request_param` varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '请求query参数',
  `request_param_explain` longtext CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '请求query参数说明',
  `request_result` longtext CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '请求结果，保存最新记录',
  `request_body` longtext CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '请求body参数',
  `request_body_explain` longtext CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '请求body参数说明',
  `request_form_data` longtext CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '请求form-data的参数',
  `success_demo` longtext CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '请求成功返回示例',
  `success_demo_explain` longtext CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '请求成功返回示例参数说明',
  `failuer_demo` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '请求失败返回示例',
  `failuer_demo_explain` longtext CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '请求失败返回示例参数说明',
  `request_remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '请求接口文档备注',
  `interface_status` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '接口状态',
  `response_headers` longtext CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '响应头',
  `project_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '项目id',
  `sort` int DEFAULT '1' COMMENT '排序',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` varchar(100) DEFAULT NULL COMMENT '创建人',
  `update_time` datetime DEFAULT NULL COMMENT '最新修改时间',
  `update_by` varchar(100) DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='系统接口';
/*!40101 SET character_set_client = @saved_cs_client */;

